  input: 'TEXT,F3N,,"To whom it may concern:  Please note that the committee ceased
    collecting contributions on July 19, 2002 and candidate is no longer seeking office.  Committee
    wishes to terminate, however, an on-line collections company, Votenet Solutions,
    Inc. has not forwarded cash collected on internet solicitations and has refused
    to respond to requests.  Committee is seeking enforcement of claims.  Contributions
    were recorded as receipts when made and offsetting debt owed to the committee
    has been recorded in lines 9 and 21 of this report.  Upon collection, refunds
    will be issued to contributors and the committee will be terminated."'
